import React, { useState } from 'react';
import { View, Text, TextInput, Button, StyleSheet } from 'react-native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { NavigationContainer } from '@react-navigation/native';

const Tab = createBottomTabNavigator();

const ProfileCreationScreen = ({ navigation }) => {
  const [username, setUsername] = useState('');
  const [age, setAge] = useState('');

  const handleProfileCreation = () => {
    // Save profile data and perform necessary actions
    // For simplicity, let's just navigate to the Profile tab
    navigation.navigate('Profile');
  };

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Create Your Profile</Text>
      <TextInput
        style={styles.input}
        placeholder="Username"
        value={username}
        onChangeText={setUsername}
      />
      <TextInput
        style={styles.input}
        placeholder="Age"
        value={age}
        onChangeText={setAge}
        keyboardType="numeric"
      />
      <Button title="Create Profile" onPress={handleProfileCreation} />
    </View>
  );
};

const StatsScreen = () => (
  <View style={styles.container}>
    <Text style={styles.title}>Stats</Text>
  </View>
);

const AddBankScreen = () => (
  <View style={styles.container}>
    <Text style={styles.title}>Add Bank</Text>
  </View>
);

const ProfileNavigator = () => (
  <Tab.Navigator>
    <Tab.Screen name="Profile" component={ProfileCreationScreen} />
    <Tab.Screen name="Stats" component={StatsScreen} />
    <Tab.Screen name="Add Bank" component={AddBankScreen} />
  </Tab.Navigator>
);

const MyTabs = () => (
  <NavigationContainer>
    <ProfileNavigator />
  </NavigationContainer>
);

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
    padding: 16,
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 16,
  },
  input: {
    height: 40,
    width: '100%',
    borderWidth: 1,
    borderColor: 'gray',
    marginBottom: 16,
    padding: 8,
  },
});

export default MyTabs;
